// Helper to decode base64 to Uint8Array
function base64ToUint8Array(base64: string): Uint8Array {
  if (typeof atob === "function") {
    // Browser or Deno
    const binary = atob(base64);
    const bytes = new Uint8Array(binary.length);
    for (let i = 0; i < binary.length; i++) {
      bytes[i] = binary.charCodeAt(i);
    }
    return bytes;
  } else {
    // Node.js fallback
    return Uint8Array.from(Buffer.from(base64, "base64"));
  }
}

// Helper to instantiate the WASM module from base64
async function loadWasm() {
  const wasmBytes = base64ToUint8Array(wasmBase64);
  const { instance } = await WebAssembly.instantiate(wasmBytes, {});
  return instance.exports;
}

// Remove export so that the functions are global (or assign to a global object if needed)
async function verifyWithWasm(
  attestation: any,
  quoteCollateral: any,
  now: bigint
) {
  const wasm = await loadWasm();
  const js_verify = wasm.js_verify as (
    raw_quote: any,
    quote_collateral: any,
    now: bigint
  ) => any;
  return js_verify(attestation, quoteCollateral, now);
}

async function getCollateralWithWasm(pccsUrl: string, attestation: any) {
  const wasm = await loadWasm();
  const js_get_collateral = wasm.js_get_collateral as (
    pccs_url: any,
    raw_quote: any
  ) => Promise<any>;
  return js_get_collateral(pccsUrl, attestation);
}

